import React from "react";
import prof from '../Images/prof.png';
import { Link,useLocation} from "react-router-dom";



const Details = (props) => {

    const locate = useLocation();

    const {name,location,id,email}  =locate.state;

    return(
        <div className="main" >
          <br/>
          <br/>
          <br/>
          <br/>
          <div align="right">
          <Link to='/'>
          <h3>Go Back</h3></Link></div>
          <h1>Personal Details</h1><p>{id}</p>
        <div className="ui card centered">
        <div className="image" >
            <img src={prof} alt="user"/>
            <div className="content">
            <div className="header"><h2>{name}</h2></div>
            <div className="description"><p>{email}</p></div>
            <div className="description"><p>{location}</p></div>
        </div>
        </div>
        </div>


        </div>
    );
}


export default Details;
